  \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-hudson-river-reptiles-reptile-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for estuarine reptiles (turtles, terrapins) and amphibians (salamanders,
  frogs) for the Hudson River. Vector polygons in this data set represent turtle,
  terrapin, and amphibian distribution. Species-specific abundance, seasonality, status,
  life history, and source information are stored in relational data tables (described
  below) designed to be used in conjunction with this spatial data layer.This data
  set comprises a portion of the Environmental Sensitivity Index (ESI) data for the
  Hudson River. ESI data characterize the marine and coastal environments and wildlife
  by their sensitivity to spilled oil. The ESI data include information for three
  main components: shoreline habitats, sensitive biological resources, and human-use
  resources.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
